import React from 'react'
import './footer.css'
import LinkedInIcon from '../../assets/linkedin_icon.png'
const Footer = () => {
  return (
    <div className='footer'>
        <div className='linkedin_icon'>
          <img src={LinkedInIcon}></img>
        </div>
    </div>
  )
}

export default Footer
